description:
Oh, what the hell... 
The quality is marginally better in the original mpg capture file, so here it is. It did record in stereo and is faithful to the original broadcast, but doing a Dead show is an art form and one that Showtime had little experience with. You just can't stick an ordinary microphone in front of that wall of sound and not get knocked on your butt.
Enjoy!


